import React from 'react'
import { Jumbotron, Button, } from 'reactstrap';
import Fade from 'react-reveal/Fade';


function HeaderHero() {

  return (
    <Jumbotron style={{ marginTop: '3rem', marginBottom: '5rem'}} >
      <Fade bottom duration={1000} delay={600} distance="30px">
        <div className="jumbotron-box d-flex justify-content-center">
          <h2 className="lead text-center">UI/UX, visual,<strong className="bold-text">Software Development Engineer</strong> with more than 2 <br />
           years of experience in designing websites and <br /> mobile apps.</h2>
        </div>
        <div className="d-flex justify-content-center hide-for-mobile" style={{ marginBottom: '2rem' }}>
          <Button href="/contactus"
            className="btn-transparency btn-transparency-primary"
            style={{ width: '25%' }}
          >know more</Button>
        </div>
        <div className="d-flex justify-content-center hide-for-desktop"
          style={{ marginBottom: '2rem', paddingLeft: '1rem', paddingRight: '1rem' }}>
          <Button href="/contactus"
            className="btn-transparency btn-transparency-primary"
          >know more</Button>
        </div>
        <style jsx>
          {`

                      .jumbotron-box{
                      padding: 2rem;
                      margin-bottom:1rem;
                      // height: 300px;
                      }

                      .lead{
                      font-size: 2.5rem;
                      }
                      .bold-text{
                        font-weight: 700;
                        color: #efac78;
                        background: #fdf2ea;
                      }



                      `}
        </style>
      </Fade>
    </Jumbotron>
  )
}

export default HeaderHero
